import React from 'react'
import {Card, Button} from 'react-bootstrap'


const CardSol = ({solution}) => {
    return (
        <Card className={solution.key} style={{marginTop: '10px'}}>
            {/* <img src={solution.image} style={{top: '0'}}/> */}
         <Card.Body>
           <Card.Title>NCERT</Card.Title>
           <Card.Subtitle className="mb-2 text-muted">{solution.name}</Card.Subtitle>
           <Card.Text>{solution.chapters}
           </Card.Text>
           <Card.Link href="#"><Button className="btn-sm" style={{}}>Get PDF</Button></Card.Link>
         </Card.Body>
       </Card>
    )
}

export default CardSol
